import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the sort/filter controls with view toggle to appear
    // Try by class first, fallback to text
    await page.waitForSelector('.view-toggle', { timeout: 5000 });

    // Find the List View button (should have class 'view-btn' and title 'List View')
    const listViewBtn = await page.$('button.view-btn[title="List View"]');
    if (!listViewBtn) {
      throw new Error('List View button not found');
    }

    // Click the List View button
    await listViewBtn.click();

    // Wait for the products-list container to appear (switch from grid to list)
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_list_view.png'));

    // Extract some data to verify list view is active
    // For example, count number of product cards in list view
    const productListItems = await page.$$eval('.products-list .product-card-list', els => els.length);

    // Also, check if the List View button now has 'active' class
    const isListViewActive = await page.$eval('button.view-btn[title="List View"]', el => el.classList.contains('active'));

    return {
      success: true,
      action: "Switched to List View Mode using the List View toggle button",
      extractedData: {
        productListItems,
        isListViewActive
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
